import React from 'react'
import { Link } from 'react-router-dom'
import { MenuItems } from './MenuItems'
import Button from '../Components/Button/Button'
import Logo from "../Assets/LogoWhite.png"
import './Navbar.css'



const NavBar = () => {
  const [active, setActive] = React.useState(false)
  const url = "https://wa.me/5545984328876?text=Gostaria%20de%20realizar%20um%20agendamento!"


  const handleClick = () => setActive(active ? false : true)

  const openWhats = () => {
    let win = window.open(url, '_blank')
    win.focus()
  }

  return (
    <div className='navbar-bg'>
      <nav className='navbar-items '>
        <Link to="/">
          <img className='navbar-logo' src={Logo} alt="" />
        </Link>




        <div className='menu-icon' onClick={handleClick}>
          <i className={active ? "fas fa-times" : "fas fa-bars"}></i>
        </div>
        <ul className={active ? "nav-menu active" : "nav-menu"}>
          {MenuItems.map((item, index) => {
            return (
              <li key={index}>
                <Link to={item.path} className={item.cName}>{item.title}</Link>
              </li>
            )
          })}
        </ul>
        <Button onClick={openWhats} buttonFixed="not-fixed">Agendar</Button>

        <div className='contact-links'>
          <div><a href="https://api.whatsapp.com/send?phone=5545984177121&text=Ol%C3%A1%2C%20gostaria%20de%20tirar%20algumas%20d%C3%BAvidas%20com%20voc%C3%AA!" target="_blank" rel='noreferrer'><i className='fa-brands fa-square-whatsapp'></i></a></div>
          <div className='ml-2'><a href="https://www.instagram.com/odonto.proteses/" target="_blank" rel='noreferrer'><i className='fa-brands fa-square-instagram'></i></a></div>
          <div className='ml-2'><a href="https://www.facebook.com/patrick.silva.182/" target="_blank" rel='noreferrer'><i className='fa-brands fa-square-facebook'></i></a></div><div className='ml-2'><a href="https://www.facebook.com/patrick.silva.182/" target="_blank" rel='noreferrer'><i className="fa-solid fa-phone-volume"></i></a></div>

        </div>
      </nav>
    </div>
  )
}

export default NavBar
